export function getApi() {
    return fetch('http://localhost:3001/despesas')
    .then(resp => {
        return resp.json()
    })
}

export function getApiEndPoint(endPoint) {
    return fetch('http://localhost:3001/despesas')
    .then(resp => {
        resp = resp.json()
        let despesas = resp.filter(despesa => despesa.mes === endPoint)
        console.log(despesas)
    })
}
